import React from "react"

export default function ToggleButton(props){
    console.log(props)
    const {id, censorType, handleChange} = props
    return (
        <form className="button-box">
            <input
                className="radio-toggle-button"
                id={id}
                type="radio"
                value={id}
                checked={censorType === id}
                onChange={handleChange}
            />
            <label
                className="radio-toggle-label"
                htmlFor={id}
            >
                <span className="radio-toggle-switch" />
            </label>
            {/* <span className="button-text"> 
                Black-Box: Text  &#10145;
                <span className="Black-Box">  Text</span>
            </span>  */}
        </form>
    )
}
